export class Task {
    id : any;
    description : string = '';
    category_id : any;
    parent_task : any;
    dead_line : any;

    constructor(id: number, description: string, category_id : number, parent_task: number ,dead_line : Date) {
        this.id = id;
        this.description = description;
        this.category_id = category_id;
        this.parent_task = parent_task;
        this.dead_line = dead_line;

      }
}
